                    các thông tin được cung cấp tại Đề nghị kiêm hợp đồng phát
                    hành, sử dụng thẻ tín dụng quốc tế dành cho khách hàng cá
                    nhân trên đây (“Đề nghị kiêm Hợp đồng”) là chính xác và xác
                    thực, do chính tôi/chúng tôi kê khai và không có thông tin
                    nào được cố ý che giấu.
                </p>
                <p>
                    3. Tôi/chúng tôi đồng ý với Hạn mức thẻ tín dụng được phê
                    duyệt sẽ được Techcombank thông báo tại tin nhắn kích hoạt
                    thẻ tín dụng tới số điện thoại mà tôi đã đăng ký trong Đề
                    nghị kiêm Hợp đồng này.
                </p>
                <p>
                    4. Tôi/chúng tôi đồng ý để Techcombank chủ động thay đổi
                    hạn mức thẻ");
            WriteLiteral(@" tín dụng của tôi theo tiêu chí xét duyệt hạn
                    mức mà Techcombank áp dụng. Hạn mức tín dụng thay đổi (nếu
                    có) sẽ được thể hiện tại tin nhắn thông báo mà Techcombank
                    gửi tới số điện thoại mà tôi đã đăng ký trong Đề nghị kiêm
                    Hợp đồng này.
                </p>
                <p>
                    5. Tôi/chúng tôi xác nhận đã được Techcombank giải thích rõ
                    về các vấn đề liên quan đến lãi suất, cách tính lãi và
                    nguyên tắc miễn lãi, biểu phí của thẻ tín dụng, bao gồm
                    nhưng không giới hạn bởi các loại phí và lãi suất bao gồm:
                    Phí phát hành, phí thường niên, phí chậm thanh toán, lãi
                    suất, cách tính lãi và nguyên tắc miễn lại của thẻ tín dụng
                </p>
